import React from 'react';
import avatar from '../img/avatar.png'
import './styles.scss';

const Card = ({ item }) => {
    return (
        <div className={`cardRanking ${item.is_himself && "selected"}`}>
            <div className="content">
                <span className="position">{item.position}ยบ</span>
                <div className="arcoAvatar"><img className="avatar" src={avatar} alt="Avatar" /></div>
                <span className="nickname">{item.user_name}</span>
            </div>

            <span className="points">{item.points}</span>
        </div>
    )
}

const Table = ({ ranking }) => {
    return (
        <aside className="tableRanking">
            <div className="header">
                <span className="title">Nome</span>
                <span className="title">Pontos</span>
            </div>
            {ranking.map((item, index) => (
                <Card key={index} item={item} />
            ))}
        </aside>
    )
}

export default Table;
